import React from "react";
import "./App.css";

import TodoClass from "./classComponents/TodoClass";

interface IState {
  texts: Array<string>
  inputValue: string;
}

class App extends React.Component<{}, IState> {
  constructor(props: {}) {
    super(props); 
    this.state = {
      inputValue: "",
      texts: []
    };
  }
  render() {
    return (
      <input 
        type="text" 
        value={this.state.inputValue}
        onChange={e => {
        this.setState(<TodoClass />)
        }}
        />
    )
  }
}

export default App;
